import React, { useState } from 'react'
import axios from 'axios'
import {
  BarChart,
  Bar,
  // Cell,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from 'recharts'
import styles from './Team.module.css'

const Team = () => {

  const teams = [];

  

  const chartData = [
    {
      name: 'asd',
      uv: 4000,
      pv: 2400,
      amt: 2400,
    },

  {
      name: 'aaaaa',
      uv: 4000,
      pv: 2900,
      amt: 2400,
    },
  ]
  
  const [uv, setUv] = useState()
  chartData.forEach( team => team.uv = uv)
  // chartData[0].uv = uv
  const addUv = (event) => {
    axios.get('http://localhost:3000/team/teams')
    .then(res => res.data)
    .then(data => console.log(data));
    let a = prompt()
    setUv(a)
  }

  return (
    <div className={styles.team}>
      <input ></input>
      <button onClick={addUv}></button>
      <ResponsiveContainer width="100%" height="100%">
        <BarChart
          width={500}
          height={300}
          data={chartData}
          margin={{
            top: 5,
            right: 30,
            left: 20,
            bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Bar dataKey="pv" fill="#8884d8" />
          <Bar dataKey="uv" fill="#82ca9d" />
        </BarChart>
      </ResponsiveContainer>
    </div>
  )
}

export default Team
